import React, { useState } from 'react';
import { Upload, Button, Tabs, List, Typography, Input, Space, message } from '@/components/ui';
import { UploadOutline } from 'lucide-react';

// Simulated API calls
const simulateApiCall = async (endpoint, formData) => {
  // In a real app, this would be replaced with actual fetch calls to your Flask backend
  return new Promise((resolve) => {
    setTimeout(() => {
      switch (endpoint) {
        case '/labels':
          resolve({
            unique_labels: 23,
            total_annotations: 3018,
            labels: [
              { label: "Sunroof", count: 27 },
              { label: "Hand Brake Button", count: 93 },
              { label: "Gearbox", count: 232 },
              { label: "Multimedia Knob Joystick", count: 116 },
              { label: "HMI Multimedia Screen", count: 147 },
              { label: "AC Climate Control Block", count: 141 },
              { label: "Touchscreen", count: 210 },
              { label: "Center Console", count: 190 },
              { label: "Armrests", count: 155 },
              { label: "Driver Seat", count: 208 }
            ]
          });
          break;
        default:
          resolve({});
      }
    }, 500);
  });
};

const App = () => {
  const [file, setFile] = useState(null);
  const [loading, setLoading] = useState(false);
  const [labels, setLabels] = useState(null);

  const handleFileUpload = async (event) => {
    const file = event.target.files[0];
    if (file) {
      setFile(file);
      setLoading(true);

      const formData = new FormData();
      formData.append('file', file);

      try {
        const response = await simulateApiCall('/labels', formData);
        setLabels(response);
        message.success('File uploaded successfully');
      } catch (error) {
        message.error('Error uploading file');
      } finally {
        setLoading(false);
      }
    }
  };

  const items = [
    {
      key: '1',
      label: 'VIEW ANNOTATIONS',
      children: 'Content for View Annotations'
    },
    {
      key: '2',
      label: 'VIEW LABELS',
      children: labels ? (
        <div className="p-4">
          <Typography.Title level={4}>Labels</Typography.Title>
          <Typography.Text>Total Unique Labels: {labels.unique_labels}</Typography.Text>
          <br />
          <Typography.Text>Total Annotations: {labels.total_annotations}</Typography.Text>
          <List
            className="mt-4"
            dataSource={labels.labels}
            renderItem={item => (
              <List.Item>
                <Typography.Text>{item.label}: {item.count}</Typography.Text>
              </List.Item>
            )}
          />
        </div>
      ) : (
        <Typography.Text>Please upload a file to view labels</Typography.Text>
      )
    },
    {
      key: '3',
      label: 'SEARCH LABELS',
      children: (
        <div className="p-4">
          <Input placeholder="Search for labels..." />
        </div>
      )
    },
    {
      key: '4',
      label: 'REMOVE LABELS',
      children: 'Content for Remove Labels'
    },
    {
      key: '5',
      label: 'MERGE LABELS',
      children: 'Content for Merge Labels'
    },
    {
      key: '6',
      label: 'RENAME LABELS',
      children: 'Content for Rename Labels'
    }
  ];

  return (
    <div className="container mx-auto p-4">
      <Typography.Title level={2}>COCO Annotation Management</Typography.Title>

      <div className="mb-4">
        <input
          type="file"
          id="fileInput"
          className="hidden"
          onChange={handleFileUpload}
          accept=".json"
        />
        <Space>
          <Button 
            onClick={() => document.getElementById('fileInput').click()}
            icon={<UploadOutline className="w-4 h-4" />}
          >
            Choose File
          </Button>
          {file && <Typography.Text>{file.name}</Typography.Text>}
        </Space>
        {file && <Typography.Text className="block mt-2">JSON file uploaded and ready for processing.</Typography.Text>}
      </div>

      <Tabs items={items} />
    </div>
  );
};

export default App;
